class Solution:
    def maximumValueSum(self, A: List[List[int]]) -> int:
        B = [nlargest(3, ((x, i) for i, x in enumerate(row))) for row in A]
        C = nlargest(9, B, key=itemgetter(0))
        res = -inf
        dp = [(0, set())]
        for row in C:
            for i in range(len(dp)):
                d, s = dp[i]
                for b, j in row:
                    if j not in s:
                        if len(s) == 2:
                            res = max(res, d + b)
                        else:
                            dp += (d + b, s | {j}),
        return res
